const findSpecialInteger = (arr) => {
  const len = arr.length
  if (len <= 1) return arr[0]
  const map = new Map()
  for (let i = 0; i < len; i++) {
    if (map.has(arr[i])) {
      const count = map.get(arr[i]) + 1
      if ((count / len * 100).toFixed(2) > 25) return arr[i]
      map.set(arr[i], count)
    } else {
      map.set(arr[i], 1)
    }
  }
}

